import { API_URL } from './config';

import axios from 'axios'
const api = axios.create({
    baseURL: API_URL
})

export async function LoginUsuario(nome, telefone, cpf, rg) {
    const r = await api.post('/usuario', {
        nome: nome,
        telefone: telefone,
        cpf: usuario.cpf,
        rg: usuario.rg
    })
    console.log(r)
    return r.data;
}
